import React from 'react';

function Title({name, title}) {
    const space = <i>&nbps;&nbps;</i>
    return (
        <div className="row text-title">
            <h1 className="mx-auto">
                {name} {space}
                <span className="text-blue">{title}</span>
            </h1>
        </div>
    );
}

export default Title;
